import React from "react";
import { motion } from "framer-motion";
import "../HomeScreen/HomeScreen.css";

function Backdrop() {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1, transition: { duration: 5 } }}
      exit={{
        opacity: 0,
        transition: { opacity: { duration: 0.5 }, delay: 5 },
      }}
      className="backdrop"
    ></motion.div>
  );
}

export default Backdrop;
